spike_success:
  la x10, tohost # spike/sim end of test communication mechanism
  addi x11, x0, 0x1 # EXIT_CODE:0(success), END_SIM:1
  sw x11, 0(x10) # write tohost
  fence.i
end_of_test_loop: # wait to be polled by spike
  nop
  j end_of_test_loop

#.align 12
mmode_trap_handler:
  csrr t6, CSR_MCAUSE
  #srli x28, x29, 63 # get msb
  #bne x28, x0, mmode_intr_handler
  li t5, 0x4 # Misaligned Load Cause Value
  beq t6, t5, mmode_misaligned_ld_handler
  # No load access faults in this test
  # li t5, 0x5 # Load Access Fault Cause Value
  # beq t6, t5, mmode_misaligned_ld_handler
  li t5, 0x6 # Misaligned Store Cause Value
  beq t6, t5, mmode_misaligned_st_handler
  # No store access faults in this test
  # li t5, 0x7 # Store Access Fault Cause Value
  # beq t6, t5, mmode_misaligned_st_handler
  mret # repeat the instruction for other causes

mmode_misaligned_ld_handler:
  csrr	t5, CSR_MEPC
	addi	t5, t5, 4 # skip the troublesome instruction
	csrw	CSR_MEPC, t5
  csrw  CSR_MCAUSE, zero # clear
	mret
mmode_misaligned_st_handler:
  csrr	t5, CSR_MEPC
	addi	t5, t5, 4 # skip the troublesome instruction
	csrw	CSR_MEPC, t5
  csrw  CSR_MCAUSE, zero # clear
	mret

.section .tohost
.global tohost; tohost: .dword 0;
.global fromhost; fromhost: .dword 0;

